   <style>
    *{
        margin: 0;
        padding: 0;
        box-sizing: border-box;
    
    }
    body{
        background-color: #121212;
        min-height: 100vh;
        overflow: hidden;
    
    }
    .mapdiv{
        display: flex;
        width: 650px;
        height: 500px;
        margin-left: 450px;
        
        top: -20%;
      
        position: absolute;
        justify-content: center;
        
    }
    .mapdiv path{
        fill:rgb(48, 61, 58);
        stroke: #c0b006;
        stroke-width: 1px;
        transition: fill 0.3s;
    }
   svg path{
    fill:#055e6d;
   }
   svg path:hover{
    fill:#076b8c;
    transition: 0.6s;
    cursor: pointer;
   }
   section .star{
    position: absolute;
    top:0;
    left: 0;
    width: 100%;
    height: 100%;
    pointer-events: none;
    animation: animate 8s ease-in-out infinite, 
    backgroundmove 16s linear infinite;
   }
   section .star.star1{
    animation-delay: 0s;
    background: url(star1.png);

   }
   section .star.star2{
    animation-delay: -1s;
    background: url(star2.png);

   }
   section .star.star3{
    animation-delay: -2s;
    background: url(star3.png);

   }
   section .star.star4{
    animation-delay: -3s;
    background: url(star4.png);

   }
   section .star.star5{
    animation-delay: -4s;
    background: url(star5.png);

   }
   section .star.star6{
    animation-delay: -5s;
    background: url(star6.png);

   }
   section .star.star7{
    animation-delay: -6s;
    background: url(star7.png);

   }
   section .star.star8{
    animation-delay: -7s;
    background: url(star8.png);

   }
   @keyframes animate{
    0%,20%,40%,60%,80%,100%{
        opacity: 0;
    }
    10%,30%,50%,70%,90%{
        opacity: 1;
    }
   }
   @keyframes backgroundmove{
    0%
    {
        transform: scale(1);
    }
    100%
    {
        transform: scale(2);
    }
   }
   @import url(https://fonts.googleapis.com/css?family=Sofia);
   *{
    font-family: 'sofia',sans-serif;
   }


   .popup_box{
    position: absolute;
    top:15%;
    left: 30%;
    transform: translate(-50%,50%);
    border-radius: 5px;
   }
   .popup_box{
    user-select: none;
    width: 400px;
    height: 390px;
    background: #f2f2f2a2;
    text-align: center;
    align-items: center;
    padding: 40px;
    border: 1px solid #b3b3b3;
    box-shadow: 1px 5px 10px gold;
    z-index: 9999;
    opacity: 0;
    pointer-events: none;
    transition: all .3s ease-in-out;
   }

   .popup_box h1{
    font-size: 30px;
    color: rgb(150, 130, 18);
    margin-bottom: 5px;

   }
   .popup_box label{
    font-size: 23px;
    color: #1f1d1d;
    margin-bottom: 5px;
    
   }
   .popup_box .btns{
    margin: 20px 0 0 0;
   }
   .btns .btn1 , .btns .btn2{
     background: rgba(91, 90, 90, 0.6);
     color: white;
     font-size: 18px;
     padding: 10px 13px;
     border: 1px solid #808080;
     border-radius: 5px;
     display: flex;
     margin-top: 10px;
  }
  .btns .btn2{
    background: rgb(152, 129, 0);
    margin-left: 0px;
    border: 1px solid rgb(167, 142, 3);
  }
  .btn1:hover{
    transition: .5s;
    background: #aaa9a9;
  }
  .btn2:hover{
    transition: .5s;
    background: rgb(137, 116, 2);
  }
